import org.apache.spark.ml.Pipeline
import org.apache.spark.ml.feature.{StringIndexer, Tokenizer, StopWordsRemover, HashingTF, VectorAssembler}
import org.apache.spark.ml.classification.LogisticRegression

//To transform the string classes to a binary-numerical representation
val classIndexer = new StringIndexer().setInputCol("Type").setOutputCol("label")
    //.setStringOrderType("alphabetDesc") //Asign 1 to Quality and 0 to Spam (Alphabetical order) NOTE: This is not supported in spark 2.2.1

//To transform the text of the tweets into tokens (array of words)    
val tokenizer = new Tokenizer().setInputCol("Tweet").setOutputCol("text_tokens")

//To remove stop words like pronouns and topic marking particles from the text    
val stopWordsRemover = new StopWordsRemover().setInputCol("text_tokens").setOutputCol("text_filtered")

//To calculate the term frequencies    
val hashingTF = new HashingTF().setNumFeatures(1000).setInputCol("text_filtered").setOutputCol("text_features")

//To assemble all the features into a single feature vector
val vectorAssembler = new VectorAssembler().setInputCols(Array("following", "followers", "actions", "is_retweet", "has_location", "text_features")).setOutputCol("features")

//To train the binary classifier for spam-vs-ham tweets    
val lr = new LogisticRegression().setMaxIter(100).setRegParam(0.001)

val pipeline = new Pipeline().setStages(Array(classIndexer, tokenizer, stopWordsRemover, hashingTF, vectorAssembler, lr))

val predictions = pipeline.fit(trainingDF).transform(trainingDF)
predictions.show(10)

